import ProfileForm from "./ProfileForm";
import styles from "./UserProfile.module.css";

const UserProfile = () => {
  return (
    <section className={styles.profile}>
      <h1 className="mx-3 position-relative">Your User Profile</h1>
      <ProfileForm />
    </section>
  );
};

export default UserProfile;
